import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { authAPI } from '../services/api';

const Dashboard = () => {
    const { user } = useAuth();
    const [profile, setProfile] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchProfile = async () => {
            try {
                const response = await authAPI.getProfile();
                setProfile(response.data);
            } catch (err) {
                setError('Failed to load profile');
                console.error('Profile fetch error:', err);
            } finally {
                setLoading(false);
            }
        };

        if (user) {
            fetchProfile();
        }
    }, [user]);

    if (loading) {
        return (
            <div className="dashboard">
                <h1>Dashboard</h1>
                <div className="card">
                    <p>Loading your profile...</p>
                </div>
            </div>
        );
    }

    return (
        <div className="dashboard">
            <h1>Welcome to VoiceAI Dashboard</h1>

            {error && (
                <div className="card" style={{ borderLeft: '4px solid #dc3545' }}>
                    <p className="error">{error}</p>
                </div>
            )}

            <div className="dashboard-grid">
                <div className="dashboard-card">
                    <h3>User Profile</h3>
                    <p><strong>Name:</strong> {String(user?.first_name || '')} {String(user?.last_name || '')}</p>
                    <p><strong>Email:</strong> {String(user?.email || profile?.email || '')}</p>
                    <p><strong>User ID:</strong> {String(user?.id || '')}</p>
                    {profile?.created_at && (
                        <p><strong>Member since:</strong> {new Date(profile.created_at).toLocaleDateString()}</p>
                    )}
                </div>

                <div className="dashboard-card">
                    <h3>VoiceAI Features</h3>
                    <p>Your VoiceAI application is ready to use! This dashboard will show your voice interactions, settings, and analytics as you use the application.</p>
                    <p>Connect your microphone and start using voice commands to interact with the AI.</p>
                </div>

                <div className="dashboard-card">
                    <h3>Quick Actions</h3>
                    <p>Here you'll find quick access to:</p>
                    <ul>
                        <li>Voice settings and preferences</li>
                        <li>Recent conversations</li>
                        <li>Audio recording history</li>
                        <li>Account management</li>
                    </ul>
                </div>

                <div className="dashboard-card">
                    <h3>System Status</h3>
                    <p><strong>Backend Connection:</strong> ✅ Connected</p>
                    <p><strong>Authentication:</strong> ✅ Active</p>
                    <p><strong>API Status:</strong> ✅ Ready</p>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
